import React, { Component } from "react";
import Link from "next/link";
import Layout from "../../../src/components/projectPages/projectLayout";
import BackgroundWriteup from "../../../src/components/projectPages/backgroundWriteup";
import ProjectVideo from "../../../src/components/projectPages/projectVideo";

class App extends Component {
  state = {};
  render() {
    return (
      <Layout
        projectImgPath="soloStander"
        projectName="Solo Stander"
        projectYear="2019"
      >
        <div className="container ">
          <BackgroundWriteup>
            <p className="text-xl text-gray-600 mx-auto mb-6 w-2/3">
              There are 265,000 people with a spinal chord injury in the United
              States alone. When faced with this difficult challenge, almost
              everyone feels as they have lost a significant amount of their
              independence.
            </p>
            <p className="text-xl text-gray-600 mx-auto mb-6 w-2/3">
              One part of this multifaceted challenge is the losing ability to
              stand and the social, practical, and health issues that come with
              it.
            </p>
            <p className="text-xl text-gray-600 mx-auto mb-6 w-2/3">
              In the spring of 2019, I led a team of engineers through the
              product design and development of a commercialization plan for a
              standing device, commissioned by a med-tech startup company based
              in San Diego.
            </p>
          </BackgroundWriteup>
          {/* <ProjectVideo /> */}
          <video controls autoplay loop muted>
            <source
              src="/img/projectPictures/soloStander/cover.mp4"
              type="video/mp4"
            />
            {/* <source src="movie.ogg" type="video/ogg"> */}
            Your browser does not support the video tag.
          </video>
        </div>
      </Layout>
    );
  }
}

export default App;
